import { FC } from 'react';
import cn from 'classnames';
import styles from './icons.module.css';
import {
    UpVector,
    DownVector,
    CheckVector,
    ProfileVector,
    RateVector,
    CameraVector,
    BookVector,
    TrashVector,
} from './vectors';

export interface IconsProps {
    className: string;
    types: string[];
}

const Icons: FC<IconsProps> = ({ className, types }) => (
    <div className={className}>
        {types.map(type => get(type))}
    </div>
);

const get = (type: string) => {
    if (type === 'up') {
        return <UpVector key={`type-${type}`} className={styles.icon} />;
    }
    if (type === 'down') {
        return <DownVector key={`type-${type}`} className={styles.icon} />;
    }
    if (type === 'check') {
        return <CheckVector key={`type-${type}`} className={styles.icon} />;
    }
    if (type === 'user') {
        return <ProfileVector key={`type-${type}`} className={styles.icon} />;
    }
    if (type === 'rate') {
        return <RateVector key={`type-${type}`} className={styles.icon} />;
    }
    if (type === 'camera') {
        return <CameraVector key={`type-${type}`} className={styles.icon} />;
    }
    if (type === 'book') {
        return <BookVector key={`type-${type}`} className={styles.icon} />;
    }
    if (type === 'trash') {
        return <TrashVector key={`type-${type}`} className={styles.icon} />;
    }
    return <></>;
};

export default Icons;
